	AppBar,
	Box,
	Button,
	TextField,
	Toolbar,
	Typography,
} from "@mui/material";
import React, { useEffect, useState } from "react";
import ImageCard from "../Components/ImageCard";

const Home = () => {
	const [list, setList] = useState({});
