		fetch(`https://dog.ceo/api/breeds/list/all`)
			.then((res) => {
				return (response = res.json());
				// setList(response.message);
			})
			.then((data) => console.log(data))
			.catch((e) => console.log(e));
	}, []);
	return (
		<Box sx={{ flexGrow: 1 }}>
			<AppBar
				position="static"
				sx={{
					display: "flex",
					flexDirection: "row",
					backgroundColor: "blue",
